import React from "react";
import Titles from "./Components/Titles"
import Form from "./Components/Form"
import Sunset from "./Components/Sunset"


const API_KEY_SUNSET =  "a453161185ff4ed4aace0896829d1561";
const API_KEY_LOCATION = "fc4039d974c24ec5a148b6eece4ea36b";

class App extends React.Component {
  /**
   * Gets location inputted by user
   */
  getLocation = async(place) => {
    place.preventDefault();
    const request_url = 'https://api.opencagedata.com/geocode/v1/json?q=Rua+Cafel%C3%A2ndia%2C+Carapicu%C3%ADba%2C+Brasil&key=fc4039d974c24ec5a148b6eece4ea36b&pretty=1';
    //const request_url = `https://api.opencagedata.com/geocode/v1/json?q=${place}&key=fc4039d974c24ec5a148b6eece4ea36b'`;
    const api_call = await fetch(request_url);
    const data = await api_call.json;
    console.log(data);
  }

  render() {
    return (
      <div>
        <Titles />
        <Form getLocation={this.getLocation}/>
        <Sunset />
      </div>
    );
  }
};

export default App;
